import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom'; // Ensure BrowserRouter is imported
import './index.css';  // Make sure this file exists and contains the correct CSS
import App from './App'; // Correct path to App.js
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root')); // Ensure the correct element id exists in index.html
root.render(
  <BrowserRouter>
    <App />
  </BrowserRouter>
);

reportWebVitals();
